            <React.Fragment>
            <Row>
                <Col><hgroup className="w-100 text-center mb-4"><h2>{sectionTitle}</h2></hgroup></Col>
            </Row>
              <div className="container">
            <Slider className="text-center"
            {...settings}>

            {this.state.slidesNo.map(function(slides){
                return (
                    <div key={slides}>
                        <Image src={'images/'+slides}/>
                    </div>
